import React, { useState } from 'react'
import Rotator from './components/rotator';
import './App.css';
import logo1 from './images/logo1-black.svg'
import logo2 from './images/logo2-white.svg'
import par from './images/par.svg'

function App(props) {


  const logos = {
    logoL: [
      logo1,
    ],
    logoS: [
      logo2
    ]

  }







  return (
    <>
      <div className="position-absolute top-50 start-50 translate-middle"><img src={logos.logoL[0]} className='Rotator1'/></div> 
      <div className="position-absolute top-50 start-50 translate-middle"><img src={logos.logoS[0]} className='Rotator2'/></div> 
      <div className="position-absolute top-0 end-0 m-2 img-fluid" id='info-box'><img src={par}/></div>
    </>
  );  
}

export default App;
